import React from "react";

const Follow = ({ followLink }) => {
  return (
    <>
      <div className="follow">
        {followLink.map((e) => {
          return (
            <a
              href="https://www.facebook.com/syedsiamchowdhury.siam"
              className="fab fa-facebook"
            ></a>
          );
        })}
      </div>
    </>
  );
};

export default Follow;
